f.hF("Home & Kitchen","\u0627\u0644\u0645\u0646\u0632\u0644 \u0648\u0627\u0644\u0645\u0637\u0628\u062e",A.a(["Furniture and large home appliances are not eligible for return.","Home decor products are accepted for return only if the product is unopened, free from any damage and must be in the original packaging.","Unwrapped bedding products will not be accepted for return.","Products that have been used, altered, assembled, or installed will not be accepted unless they are defective."],s),A.a(["\u0644\u0627 \u064a\u0633\u0645\u062d \u0628\u0627\u0633\u062a\u0631\u062c\u0627\u0639 \u0627\u0644\u0623\u062b\u0627\u062b \u0648\u0627\u0644\u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u0645\u0646\u0632\u0644\u064a\u0629 \u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u062d\u062c\u0645.","\u064a\u0642\u0628\u0644 \u0627\u0633\u062a\u0631\u062c\u0627\u0639 \u0645\u0646\u062a\u062c\u0627\u062a \u062f\u064a\u0643\u0648\u0631 \u0627\u0644\u0645\u0646\u0632\u0644 \u0641\u0642\u0637 \u0625\u0630\u0627 \u0644\u0645 \u062a\u0641\u062a\u062d\u060c \u0648\u0643\u0627\u0646\u062a \u0633\u0644\u064a\u0645\u0629 \u0645\u0646 \u0623\u064a \u0636\u0631\u0631\u060c \u0648\u0641\u064a \u062a\u063a\u0644\u064a\u0641\u0647\u0627 \u0627\u0644\u0623\u0635\u0644\u064a.","\u0644\u0627 \u064a\u0642\u0628\u0644 \u0627\u0633\u062a\u0631\u062c\u0627\u0639 \u0645\u0646\u062a\u062c\u0627\u062a \u0623\u063a\u0637\u064a\u0629 \u0627\u0644\u0633\u0631\u064a\u0631 \u0627\u0644\u0645\u0641\u062a\u0648\u062d\u0629.","\u0644\u0627 \u062a\u0642\u0628\u0644 \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u062a\u064a \u0627\u0633\u062a\u062e\u062f\u0645\u062a \u0623\u0648 \u062e\u0636\u0639\u062a \u0644\u0644\u062a\u0639\u062f\u064a\u0644 \u0623\u0648 \u0627\u0644\u062a\u062c\u0645\u064a\u0639 \u0623\u0648 \u0627\u0644\u062a\u0631\u0643\u064a\u0628 \u0625\u0644\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0645\u0639\u064a\u0628\u0629."],s),5,1)
